function ContactItem(props) {
    // console.log(props);
    // console.log(props[0].name);
    let contacts = Array.from(props);
    // Array.from(contacts);
    console.log(contacts);
    return (
        <section>
            <div>
                <h1>Picture</h1>
                <h1>Name</h1>
                <h1>Popularity</h1>
            </div>
            {contacts.map((item) => {
                return (<div>
                    <img src={item.pictureUrl} alt={item.name}></img>
                    <p>{item.name}</p>
                    <p>{item.popularity}</p>
                </div>);

            })}
        </section>
    );
}

export default ContactItem;
